// EventsPage.js
import React, { useEffect, useState } from 'react';
import { getEvents } from './services/eventService';

const EventsPage = () => {
  const [events, setEvents] = useState([]);

  useEffect(() => {
    getEvents()
      .then(data => setEvents(data))
      .catch(error => console.error(error));
  }, []);

  // Render logic...
};
